// src/Sidebar.js

import React from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" className="flex-column sidebar">
      <Navbar.Brand as={Link} to="/" className="text-center">
        <h3>MyApp</h3>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="sidebar-nav" />
      <Navbar.Collapse id="sidebar-nav">
        <Nav className="flex-column">
          <Nav.Link as={Link} to="/job" className="nav-item">Job Schedule</Nav.Link>
          <Nav.Link as={Link} to="/about" className="nav-item">About</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default Sidebar;
